import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createDrawerNavigator } from "@react-navigation/drawer";
import { createStackNavigator } from "@react-navigation/stack";
import Login from "../screens/Login";
import SignUp from "../screens/SignUp";
import { Colors } from "../components/styles";
import { DrawerContent } from "../components/DrawerContent";
import { justifyContent } from "styled-system";
import Homepage from './../screens/Homepage';
import MyInformation from './../screens/MyInformation';
import MyPackages from './../screens/MyPackages';
import MyAccount from './../screens/MyAccount';
import ViewInformation from './../screens/ViewInformation';
import UpdateContactDetails from './../screens/UpdateContactDetails';
import UpdateAccount from './../screens/UpdateAccount';
import Agreement from './../screens/Agreement';
import ViewPackage from './../screens/ViewPackage';
import UpdateInformation from './../screens/UpdateInformation';
import UpdateAddress from './../screens/UpdateAddress';
const { brand, tertiary, primary } = Colors;

const Stack = createStackNavigator();

const Drawer = createDrawerNavigator();

const RootStack = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator
        screenOptions={{
            headerStyle: { backgroundColor: "transparent" },
            headerTintColor: tertiary,
            headerTransparent: true,
            headerTitle: "",
            headerLeftContainerStyle: {
              paddingLeft: 20,
            },
          }}
          initialRouteName="Login"
      >
        <Stack.Screen name="Login" component={Login} />
        <Stack.Screen name="SignUp" component={SignUp} />
        <Stack.Screen name="Homepage" component={Homepage} />
        <Stack.Screen name="MyInformation" component={MyInformation} />
        <Stack.Screen name="MyAccount" component={MyAccount} />
        <Stack.Screen name="UpdateAccount" component={UpdateAccount} />
        <Stack.Screen name="MyPackages" component={MyPackages} />
        <Stack.Screen name="ViewInformation" component={ViewInformation} />
        <Stack.Screen name="UpdateContactDetails" component={UpdateContactDetails} />
        <Stack.Screen name="Agreement" component={Agreement} />
        <Stack.Screen name="ViewPackage" component={ViewPackage} />
        <Stack.Screen name="UpdateInformation" component={UpdateInformation} />
        <Stack.Screen name="UpdateAddress" component={UpdateAddress} />
        
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default RootStack;
